import React, { useEffect } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Card from '@material-ui/core/Card';
const useStyles = makeStyles((theme) => ({
    root: {
    },
    textField: {
        marginLeft: theme.spacing(1),
        marginRight: theme.spacing(1),
        width: '25ch',
    },
}));
export function CreateNewRestaurant(props) {
    const classes = useStyles();
    return (
        <Card style={{ padding: "2%" }}>
            <form className={classes.root}>
                <TextField
                    id="restaurantName"
                    label="Tên nhà hàng"
                    style={{ margin: 8 }}
                    placeholder=""
                    // helperText="Full width!"
                    fullWidth
                    margin="normal"
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
                <TextField
                    id="address"
                    label="Tên nhà hàng"
                    style={{ margin: 8 }}
                    placeholder=""
                    // helperText="Full width!"
                    fullWidth
                    margin="normal"
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
                <TextField
                    id="standard-full-width"
                    label="Tên nhà hàng"
                    style={{ margin: 8 }}
                    placeholder=""
                    helperText="Full width!"
                    fullWidth
                    margin="normal"
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
                <TextField
                    id="standard-full-width"
                    label="Tên nhà hàng"
                    style={{ margin: 8 }}
                    placeholder=""
                    helperText="Full width!"
                    fullWidth
                    margin="normal"
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
                 <TextField id="standard-basic" label="Standard" />
                 <TextField id="standard-basic" label="Standard" />
                 <TextField id="standard-basic" label="Standard" />
            </form>
        </Card>
    );
}
